import React, { useState, useEffect, useRef } from 'react';

// --- Theme Colors ---
const theme = {
  sage: "#96A78D",
  mint: "#B6CEB4",
  lightSage: "#D9E9CF",
  offWhite: "#F0F0F0"
};

// --- SVG Icon Components (Lucide Icons) ---
const HomeIcon = ({ className = "h-5 w-5" }) => (<svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><path d="m3 9 9-7 9 7v11a2 2 0 0 1-2 2H5a2 2 0 0 1-2-2z"></path><polyline points="9 22 9 12 15 12 15 22"></polyline></svg>);
const UsersIcon = ({ className = "h-5 w-5" }) => (<svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><path d="M16 21v-2a4 4 0 0 0-4-4H6a4 4 0 0 0-4 4v2"></path><circle cx="9" cy="7" r="4"></circle><path d="M22 21v-2a4 4 0 0 0-3-3.87"></path><path d="M16 3.13a4 4 0 0 1 0 7.75"></path></svg>);
const FileIcon = ({ className = "h-5 w-5" }) => (<svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><path d="M14.5 2H6a2 2 0 0 0-2 2v16a2 2 0 0 0 2 2h12a2 2 0 0 0 2-2V7.5L14.5 2z"></path><polyline points="14 2 14 8 20 8"></polyline></svg>);
const AlertCircleIcon = ({ className = "h-5 w-5" }) => (<svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><circle cx="12" cy="12" r="10"></circle><line x1="12" y1="8" x2="12" y2="12"></line><line x1="12" y1="16" x2="12.01" y2="16"></line></svg>);
const SearchIcon = ({ className = "h-5 w-5" }) => (<svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><circle cx="11" cy="11" r="8"></circle><line x1="21" y1="21" x2="16.65" y2="16.65"></line></svg>);
const MoreVerticalIcon = ({ className = "h-5 w-5" }) => (<svg xmlns="http://www.w3.org/2000/svg" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round" className={className}><circle cx="12" cy="12" r="1"></circle><circle cx="12" cy="5" r="1"></circle><circle cx="12" cy="19" r="1"></circle></svg>);

// --- Mock Data (unchanged) ---
const initialUsers = [ /* ... same as your version ... */ ];
const stats = [ /* ... same as your version ... */ ];
const monthlyUsageData = { /* ... same ... */ };
const fileTypeData = { /* ... same ... */ };
const demographicsData = { /* ... same ... */ };

// --- Chart Fallback ---
const ChartFallback = () => (
  <div className="flex items-center justify-center h-full border rounded-lg p-4 text-gray-700 bg-red-50 border-red-200">
    <AlertCircleIcon className="h-6 w-6 mr-3" />
    <p className="text-sm font-medium">
      Chart.js is not loaded globally. Please ensure the library CDN is available.
    </p>
  </div>
);

// --- Chart Hook ---
const useChart = (config) => {
  const chartRef = useRef(null);

  useEffect(() => {
    if (chartRef.current && typeof window.Chart !== "undefined") {
      const ctx = chartRef.current.getContext("2d");
      if (chartRef.current.chartInstance) chartRef.current.chartInstance.destroy();
      const chartInstance = new window.Chart(ctx, config);
      chartRef.current.chartInstance = chartInstance;

      return () => chartInstance.destroy();
    }
  }, [config]);

  if (typeof window.Chart === "undefined") {
    return <ChartFallback />;
  }

  return <canvas ref={chartRef} className="w-full h-full"></canvas>;
};

// --- Chart Components (unchanged colors for graphs) ---
const LineChart = () => {
  const config = {
    type: "line",
    data: {
      labels: monthlyUsageData.labels,
      datasets: [{
        label: "Monthly Storage Usage (GB)",
        data: monthlyUsageData.data,
        borderColor: "#3b82f6",
        backgroundColor: "rgba(59,130,246,0.2)",
        fill: true,
        tension: 0.4
      }]
    },
    options: {
      responsive: true,
      maintainAspectRatio: false,
      scales: { y: { beginAtZero: true } },
    }
  };
  return useChart(config);
};

const PieChart = () => { /* same as before */ };
const BarChart = () => { /* same as before */ };

// --- Layout Components with theme colors ---
const Sidebar = ({ activeView, setActiveView }) => {
  const navItems = [
    { name: "Dashboard", icon: HomeIcon },
    { name: "Users", icon: UsersIcon },
    { name: "Queries", icon: AlertCircleIcon },
  ];

  return (
    <aside
      className="w-64 flex-shrink-0 flex flex-col p-4 shadow-xl text-gray-800"
      style={{ backgroundColor: theme.sage }}
    >
      <div className="text-white text-2xl font-bold mb-10 flex items-center gap-2">
        <svg xmlns="http://www.w3.org/2000/svg" width="28" height="28" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
          <rect x="3" y="11" width="18" height="11" rx="2" ry="2" />
          <path d="M7 11V7a5 5 0 0 1 10 0v4" />
        </svg>
        <span>Digital Locker</span>
      </div>
      <ul>
        {navItems.map(item => (
          <li key={item.name}>
            <button
              onClick={() => setActiveView(item.name)}
              className={`flex items-center w-full gap-3 px-4 py-3 my-1 rounded-lg transition-colors ${
                activeView === item.name
                  ? "bg-[#B6CEB4] text-gray-800 font-semibold"
                  : "hover:bg-[#D9E9CF]"
              }`}
            >
              <item.icon />
              <span>{item.name}</span>
            </button>
          </li>
        ))}
      </ul>
    </aside>
  );
};

const Header = ({ title }) => (
  <header
    className="sticky top-0 z-10 p-4 flex justify-between items-center shadow-sm"
    style={{ backgroundColor: theme.lightSage }}
  >
    <h1 className="text-2xl font-semibold text-gray-800">{title}</h1>
    <div className="flex items-center gap-3">
      <img
        src="https://i.pravatar.cc/150?u=admin"
        alt="Admin"
        className="h-10 w-10 rounded-full ring-2 ring-[#96A78D] object-cover"
      />
      <div>
        <p className="font-semibold text-sm text-gray-800">Admin User</p>
        <p className="text-xs text-gray-600">System Administrator</p>
      </div>
    </div>
  </header>
);

const ChartContainer = ({ title, children }) => (
  <div
    className="p-6 rounded-xl shadow-md h-full flex flex-col"
    style={{ backgroundColor: theme.offWhite }}
  >
    <h3 className="text-lg font-semibold mb-4 border-b pb-2 text-gray-800">
      {title}
    </h3>
    <div className="flex-1 min-h-[250px]">{children}</div>
  </div>
);

const StatCard = ({ item }) => (
  <div
    className="p-6 rounded-xl shadow-md flex items-start justify-between"
    style={{ backgroundColor: theme.offWhite }}
  >
    <div>
      <p className="text-sm font-medium text-gray-600">{item.name}</p>
      <p className="text-3xl font-bold text-gray-800 mt-1">{item.value}</p>
      <p className="text-xs mt-2 text-green-700">{item.change}</p>
    </div>
    <div className={`${item.color} p-3 rounded-full text-white`}>
      <item.icon className="h-6 w-6" />
    </div>
  </div>
);

const DashboardView = () => (
  <div className="space-y-6">
    <h2
      className="text-xl font-semibold text-gray-800"
      style={{ color: theme.sage }}
    >
      System Overview
    </h2>
    <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
      {stats.map((item) => (
        <StatCard key={item.name} item={item} />
      ))}
    </div>

    <h2
      className="text-xl font-semibold text-gray-800 pt-2"
      style={{ color: theme.sage }}
    >
      Analytics & Usage Statistics
    </h2>
    <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
      <div className="lg:col-span-2 min-h-[400px]">
        <ChartContainer title="Monthly Storage Usage (GB) - Trend">
          <LineChart />
        </ChartContainer>
      </div>
      <div className="lg:col-span-1 min-h-[400px]">
        <ChartContainer title="User Demographics by Plan - Proportion">
          <PieChart />
        </ChartContainer>
      </div>
    </div>

    <div className="pt-2 min-h-[400px]">
      <ChartContainer title="Storage Breakdown by File Type - Comparison">
        <BarChart />
      </ChartContainer>
    </div>
  </div>
);

// --- Users & Queries Views remain same, only background updated ---
const UsersView = () => { /* same content, wrap table container with theme.offWhite */ };
const QueriesView = () => { /* same, backgroundColor: theme.offWhite */ };

// --- Main App ---
export default function App() {
  const [activeView, setActiveView] = useState("Dashboard");

  const renderContent = () => {
    switch (activeView) {
      case "Dashboard": return <DashboardView />;
      case "Users": return <UsersView />;
      case "Queries": return <QueriesView />;
      default: return <DashboardView />;
    }
  };

  return (
    <div className="flex h-screen font-sans antialiased"
         style={{ backgroundColor: theme.offWhite }}>
      <Sidebar activeView={activeView} setActiveView={setActiveView} />
      <main className="flex-1 flex flex-col overflow-hidden">
        <Header title={activeView} />
        <div className="flex-1 p-6 overflow-y-auto">{renderContent()}</div>
      </main>
    </div>
  );
}
